      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE - 5 NOT IN ( - col0 * + 15, + col2 / + col2 * - col0 * col1, + col2 - + - 33 );
  - name: tab0

outputs:
  - name: q7214.out
    data: |
      15	81	47
      87	21	10
      97	1	99
